class AlphaNum{static encode(e){return e.toLowerCase().split("").map(e=>{if(" "===e)return" ";let t=e.charCodeAt(0);return t>=97&&t<=122?t-96:e}).join("-").replace(/- -/g," ")}static decode(e){return e.split(" ").map(e=>e.split("-").map(e=>{let t=parseInt(e,10)+96;return t>=97&&t<=122?String.fromCharCode(t):""}).join("")).join(" ")}}module.exports=AlphaNum;